randomIndex = () => {
    const results = []
    while (results.length < 12) {
        const num = Math.floor(Math.random() * 12)
        if (results.indexOf(num) === -1) results.push(num)
    }
    return results
}

randomize = (chars) => {
    const results = randomIndex()
    const newChars = chars.map(char => (randomIndex(char.id)))
    console.log(newChars)
}


